(2, 'Entwine (blue)', 'A classic two columns layout designed with a twist of modern curves in blue color, highlighting headline titles valuable for your newsletter to attract more customer, best for promos and events.', '<table style=\"width: 100%; margin: 0pt auto; background-color:#08395a; color: #333333; font-family: Arial,Tahoma,Geneva,Kalimati,sans-serif;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td align=\"center\" valign=\"top\">\n<table style=\"margin: auto; width: 700px; height: 70px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td style=\"width: 8px;\" rowspan=\"2\" align=\"right\" valign=\"top\"><img src=\"media/com_jnews/templates/entwine/blue/topleft_header.png\" border=\"0\" alt=\"jnews logo\" style=\"display:block;margin:0;\" /></td>\n<td>\n<table style=\"width: 100%;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td height=\"58\" bgcolor=\"#1a79a9\">\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"100%\">\n<tbody>\n<tr>\n<td style=\"width: 70%;\">\n<h1><img src=\"https://joobi.org/images/newsletter_templates/entwine/blue/logo-big.png\" border=\"0\" alt=\"jnews logo\" style=\"margin-left: 20px;display:block;margin:0;\" /></h1>\n</td>\n<td style=\"width: 30%;\" align=\"right\">\n<h6>{tag:date}</h6>\n</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td style=\"background-color: #ffffff; height: 58px; text-align: center;\" height=\"58\">\n<h2>jNews is now out in the market!</h2>\n</td>\n</tr>\n</tbody>\n</table>\n</td>\n<td style=\"width: 8px;\" rowspan=\"2\" align=\"left\" valign=\"top\"><img src=\"media/com_jnews/templates/entwine/blue/topright_header.png\" border=\"0\" alt=\"jnews logo\" style=\"display:block;margin:0;\" /></td>\n</tr>\n</tbody>\n</table>\n<table style=\"margin: auto; width: 700px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td style=\" font-family: Arial, Tahoma, Geneva, Kalimati, sans-serif;\"><span style=\"font-si