,147/controller,ticket/\"> Support </a></td>\n<td style=\"width: 20px;\"></td>\n<td class=\"readmore\"><a href=\"https://joobi.org/component/option,com_agora/Itemid,60/\"> Forum </a></td>\n<td style=\"width: 20px;\"></td>\n<td class=\"readmore\"><a href=\"https://joobi.org/organization/about/welcome-to-joobi-live-support.html\"> Live Admin </a></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\" align=\"center\">Would you like to change your subscription? {tag:subscriptions}<br /> Not interested any more? {tag:unsubscribe}</td>\n</tr>\n</tbody>\n</table>\n<table style=\"margin: auto; width: 702px; height: 70px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td style=\"width: 8px;\" rowspan=\"2\" valign=\"top\"><img src=\"media/com_jnews/templates/entwine/blue/bottom_left_blue.png\" border=\"0\" alt=\"jnews logo\" style=\"display:block;margin:0;\" /></td>\n<td style=\"width: 686px;\">\n<table style=\"width: 100%;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td colspan=\"3\" bgcolor=\"#ffffff\"><span style=\"font-size: 16px; color: #fff;\"> joobi </span></td>\n</tr>\n<tr>\n<td height=\"118\" bgcolor=\"#025b87\">\n<table border=\"0\" cellspacing=\"5\" cellpadding=\"0\" width=\"100%\">\n<tbody>\n<tr>\n<td colspan=\"3\" bgcolor=\"#025b87\">\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"5\" width=\"100%\">\n<tbody>\n<tr>\n<td>\n<h5>Latest Testimonials</h5>\n<h6>It feels to me that live chat is the absolute best way to provide customer support...</h6>\n<br /> <a href=\"#\"> Read more </a></td>\n<td>\n<h5>More Powerful Features!</h5>\n<h6>Wanted to design your own newsletter template? Check our jNews PRO version.</h6>\n<br /> <a href=\"#\"> See more </a></td>\n<td valign=\"bottom\"><img src=\"https://joobi.org/images/newsletter_templates/entwine/blue/logo-small.png\" border=\"0\" alt=\"jnewsletter logo\" style=\"margin:0 0 0 20px;\" /></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n</tbody>\n</table>\n<