(12, 'Simplicity', 'Bring out the best of your content with this light and clean simple newsletter.', '<div style=\"background-color:#FFFFFF;\">\n<p> </p>\n<table style=\"height: 100%;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"100%\" bgcolor=\"#9edaf4\">\n<tbody>\n<tr>\n<td align=\"center\" valign=\"top\">\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"600\">\n<tbody>\n<tr>\n<td valign=\"top\">\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"100%\">\n<tbody>\n<tr>\n<td colspan=\"2\" valign=\"middle\">\n<div>\n<h1><img src=\"https://joobi.org/images/newsletter_templates/simplicity/jnews_logo.png\" border=\"0\" width=\"241px\" height=\"91px\" /></h1>\n</div>\n</td>\n</tr>\n<tr>\n<td valign=\"middle\">\n<div>\n<h3>Your Top Communication Partner</h3>\n</div>\n</td>\n<td width=\"30%\" valign=\"bottom\">\n<div style=\"text-align:right;\">\n<h5>{tag:date}</h5>\n</div>\n</td>\n</tr>\n<tr>\n</tr>\n</tbody>\n</table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"600\" bgcolor=\"#ffffff\">\n<tbody>\n<tr>\n<td align=\"center\" valign=\"top\">\n<table border=\"0\" cellspacing=\"30\" cellpadding=\"0\" width=\"600\">\n<tbody>\n<tr>\n<td>\n<h2>jNews is now out in the market!</h2>\n</td>\n<td style=\"margin-top:20px;\" rowspan=\"2\"><img src=\"https://joobi.org/images/jnews_newsletter.png\" border=\"0\" width=\"130px\" height=\"215px\" /></td>\n</tr>\n<tr>\n<td valign=\"top\">\n<p>Hi {tag:firstname},<br /><br /> This 2012, we are coming out with a application that will bring email marketing to the next generation. This is jNews. <br /><br /> jNews is our newest products, an email marketing application for Joomla 1.5, 1.6, 1.7 and 2.5 with the most powerful and coolest features ever making sure that your communications yields the best results that you want. {tag:share name=facebook,linkedin,twitter}</p>\n</td>\n</tr>\n<tr>\n<td valign=\"top\">\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td class=\"readmore\" width=\"113px\" height=\"38px;\" align=\"center\" valign=\"center\" background=\"media/com_jnews/templates/simplicity/images/bttn.png\"><a href=\"#\">Live Demo</a></td>\n<td style=\"width: 30px;\" width=\"10\"></td>\n<td class=\"readmore\" width=\"113px\" height=\"38px;\" align=\"center\" valign=\"center\" background=\"media/com_jnews/templates/simplicity/images/bttn.png\"><a href=\"#\">Documentation</a></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td align=\"center\" valign=\"top\">\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"600\">\n<tbody>\n<tr>\n<td colspan=\"2\">\n<hr width=\"560px\" size=\"1\" />\n</td>\n</tr>\n<tr>\n<td width=\"280\" valign=\"top\">\n<table border=\"0\" cellspacing=\"30\" cellpadding=\"0\" width=\"100%\">\n<tbody>\n<tr>\n<td valign=\"top\">\n<div>\n<h4>Need Help?</h4>\n<p>Should you have questions, comments, feature requests, do not hesitate to contact our support or chat live with them.</p>\n<ul>\n<li>Live Chat</li>\n<li>Support</li>\n<li>Forum</li>\n</ul>\n</div>\n</td>\n</tr>\n</tbody>\n</table>\n</td>\n<td width=\"280\" valign=\"top\">\n<table border=\"0\" cellspacing=\"30\" cellpadding=\"0\" width=\"100%\">\n<tbody>\n<tr>\n<td valign=\"top\">\n<div>\n<h4>Spread the News</h4>\n<p>Know someone who might be interested in this newsletter? {tag:fwdtofriend name=Forward to a friend.}</p>\n<br /><br />\n<p>Would you like to {tag:subscriptions}?<br /> Not interested any more? {tag:unsubscribe}</p>\n</div>\n</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td align=\"center\" valign=\"top\">\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"600\" bgcolor=\"#9edaf4\">\n<tbody>\n<tr>\n<td valign=\"top\">\n<table border=\"0\" cellspacing=\"30\" cellpadding=\"0\" width=\"100%\">\n<tbody>\n<tr>\n<td colspan=\"2\" align=\"center\" valign=\"middle\">\n<div><a class=\"footer\" href=\"#\">This email contains graphics, if you don\'t see them {tag:viewonline name=view it in your browser}.</a><br /> <a class=\"footer\" href=\"#\">Powered by Joobi</a></div>\n</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n</tbody>\n</table>\n</div>', '', 1319652945, 1, 1, 99, 'simplicity', 'a:12:{s:8:\"color_bg\";s:7:\"#FFFFFF\";s:8:\"style_h1\";s:197:\"color:#ffffff; display:block; font-family:Arial,Helvetica,Serif; font-size:48px; font-weight:bold; line-height:100%; margin-bottom:0px; margin-left:0; margin-right:0; margin-top:0; text-align:left;\";s:8:\"style_h2\";s:182:\"color:#355f77; display:block; font-family:Arial,Helvetica,Serif; font-size:24px; font-weight:normal; line-height:100%; margin-bottom:0px; margin-left:0; margin-right:0; margin-top:0;\";s:8:\"style_h3\";s:216:\"color:#4f88a7; display:block; font-family:Arial,Helvetica,Serif; font-size:14px; font-weight:normal; line-height:100%; margin-bottom:30px; margin-left:0; margin-right:0; margin-top:0; text-shadow:1px 0px 0px #aee0f6;\";s:8:\"style_h4\";s:200:\"color:#355f77; display:block; font-family:Arial,Helvetica,Serif; font-size:18px; font-weight:normal; line-height:100%; margin-bottom:10px; margin-left:0; margin-right:0; margin-top:0; text-align:left;\";s:8:\"style_h5\";s:216:\"color:#4f88a7; display:block; font-family:Arial,Helvetica,Serif; font-size:13px; font-weight:normal; line-height:100%; margin-bottom:30px; margin-left:0; margin-right:0; margin-top:0; text-shadow:1px 0px 0px #aee0f6;\";s:7:\"style_a\";s:87:\"color:#416e86; font-family:Arial,Helvetica,Serif; font-size:13px; text-decoration:none;\";s:8:\"style_ul\";s:83:\"color:#416e86; font-family:Arial,Helvetica,Serif; font-size:13px; line-height:200%;\";s:8:\"readmore\";s:173:\"background-color:#b5e2f7; background-repeat:no-repeat; height:38px; margin-bottom:10px; margin-left:10px; margin-right:10px; margin-top:10px; text-align:center; width:113px;\";s:16:\"style_aca_onlin