(13, 'Entwine (green)', 'A classic two columns layout designed with a twist of modern curves in green color, highlighting headline titles valuable for your newsletter to attract more customer, best for promos and events.', '<table style=\"width: 100%; margin: 0pt auto; background-color:#003300; color: #333333; font-family: Arial,Tahoma,Geneva,Kalimati,sans-serif;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td align=\"center\" valign=\"top\">\n<table style=\"margin: auto; width: 700px; height: 70px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td style=\"width: 8px;\" rowspan=\"2\" align=\"right\" valign=\"top\"><img src=\"media/com_jnews/templates/entwine/green/topleft_header.png\" border=\"0\" alt=\"jnews logo\" style=\"display:block;margin:0;\" /></td>\n<td>\n<table style=\"width: 100%;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td height=\"58\" bgcolor=\"#4f7e11\">\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"100%\">\n<tbody>\n<tr>\n<td style=\"width: 70%;\">\n<h1><img src=\"https://joobi.org/images/newsletter_templates/entwine/green/logo-big.png\" border=\"0\" alt=\"jnews logo\" style=\"margin-left: 20px;display:block;margin:0;\" /></h1>\n</td>\n<td style=\"width: 30%;\" align=\"right\">\n<h6>{tag:date}</h6>\n</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td style=\"background-color: #ffffff; height: 58px; text-align: center;\" height=\"58\">\n<h2>jNews is now out in the market!</h2>\n</td>\n</tr>\n</tbody>\n</table>\n</td>\n<td style=\"width: 8px;\" rowspan=\"2\" align=\"left\" valign=\"top\"><img src=\"media/com_jnews/templates/entwine/green/topright_header.png\" border=\"0\" alt=\"jnews logo\" style=\"display:block;margin:0;\" /></td>\n</tr>\n</tbody>\n</table>\n<table style=\"margin: auto; width: 700px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td style=\" font-family: Arial, Tahoma, Geneva, Kalimati, sans-serif;\"><span style=\"font-size: 12px; color: #003300;\">joobi</span></td>\n</tr>\n</tbody>\n</table>\n<table style=\"margin: auto; width: 680px; background-color: #ffffff;\" border=\"0\" cellspacing=\"20\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td style=\"width: 250px;\" width=\"250\" align=\"left\" valign=\"top\">\n<p style=\"text-align: center; width: 250px;\"><img src=\"https://joobi.org/images/jnews_newsletter.png\" border=\"0\" alt=\"jNews Upgrade\" width=\"130\" height=\"215\" style=\"display: block; border: 0; margin: 0px auto;\" /></p>\n<h3>What is it in for you?</h3>\n<ul>\n<li>Template Management</li>\n<li>Queue Management</li>\n<li>Advanced Statistics</li>\n<li>Sending Process</li>\n</ul>\n</td>\n<td valign=\"top\">\n<p>Hi {tag:name},</p>\n<br />\n<p>This 2010, we are coming out with a application that will bring email marketing to the next generation. This is jNews.<br /><br /> jNews is our newest products, an email marketing application for Joomla 1.5 with the most powerful and coolest features ever making sure that your communications yields the best results that you want.</p>\n<br />\n<p>{tag:share name=facebook,linkedin,twitter}</p>\n<br /> \n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td style=\"width: 49px;\"></td>\n<td class=\"readmore\"><a href=\"https://joobi.org/component/option,com_jmarket/Itemid,49/controller,product-display/eid,82/task,show/\"> Product Presentation </a></td>\n<td style=\"width: 20px;\"></td>\n<td class=\"readmore\"><a href=\"https://joobi.org/Help/jNews/Table-of-Contents-jNews.html\"> Documentation </a><br /></td>\n</tr>\n</tbody>\n</table>\n<hr style=\"width: 98%;\" />\n<p style=\"font-size:12px;\">Should you have questions, comments, feature requests, do not hesitate to contact our support or chat live with them.</p>\n<br /><br /> \n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td style=\"width: 55px;\"></td>\n<td class=\"readmore\"><a href=\"https://joobi.org/component/option,com_jtickets/Itemid,147/controller,ticket/\"> Support </a></td>\n<td style=\"width: 20px;\"></td>\n<td class=\"readmore\"><a href=\"https://joobi.org/component/option,com_agora/Itemid,60/\"> Forum </a></td>\n<td style=\"width: 20px;\"></td>\n<td class=\"readmore\"><a href=\"https://joobi.org/organization/about/welcome-to-joobi-live-support.html\"> Live Admin </a></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td colspan=\"2\" align=\"center\">Would you like to change your subscription? {tag:subscriptions}<br /> Not interested any more? {tag:unsubscribe}</td>\n</tr>\n</tbody>\n</table>\n<table style=\"margin: auto; width: 702px; height: 70px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td style=\"width: 8px;\" rowspan=\"2\" valign=\"top\"><img src=\"media/com_jnews/templates/entwine/green/bottom_left_green.png\" border=\"0\" alt=\"jnews logo\" style=\"display:block;margin:0;\" /></td>\n<td style=\"width: 686px;\">\n<table style=\"width: 100%;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td colspan=\"3\" bgcolor=\"#ffffff\"><span style=\"font-size: 16px; color: #fff;\"> joobi </span></td>\n</tr>\n<tr>\n<td height=\"118\" bgcolor=\"#4f7e11\">\n<table border=\"0\" cellspacing=\"5\" cellpadding=\"0\" width=\"100%\">\n<tbody>\n<tr>\n<td colspan=\"3\" bgcolor=\"#4f7e11\">\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"5\" width=\"100%\">\n<tbody>\n<tr>\n<td>\n<h5>Latest Testimonials</h5>\n<h6>It feels to me that live chat is the absolute best way to provide customer support...</h6>\n<br /> <a href=\"#\"> Read more </a></td>\n<td>\n<h5>More Powerful Features!</h5>\n<h6>Wanted to design your own newsletter template? Check our jNews PRO version.</h6>\n<br /> <a href=\"#\"> See more </a></td>\n<td valign=\"bottom\"><img src=\"https://joobi.org/images/newsletter_templates/entwine/green/logo-small.png\" border=\"0\" alt=\"jnewsletter logo\" style=\"margin:0 0 0 20px;\" /></td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n</tbody>\n</