(647, 'COM_PRIVACY_CONFIRM_REQUEST_FIELDSET_LABEL', 'Un courrier électronique a été envoyé à votre adresse mail. Le courrier électronique a un identifiant de sécurité, merci de confirmer de nouveau votre adresse mail et collez l\'identifiant de sécurité dans le champ ci-dessous pour prouver que vous êtes le propriétaire des informations demandées.', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_privacy.ini'),
(648, 'COM_PRIVACY_CONFIRM_REQUEST_SUCCEEDED', 'Votre demande d\'informations a été confirmée. Nous traiterons votre demande dès que possible et l\'exportation sera envoyée à votre adresse e-mail.', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_privacy.ini'),
(649, 'COM_PRIVACY_CREATE_REQUEST_SUCCEEDED', 'Votre demande d\'informations a été créée. Avant qu\'elle soit traitée, vous devez vérifier cette demande. Un courrier électronique a été envoyé à votre adresse avec des instructions supplémentaires pour compléter cette vérification.', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_privacy.ini'),
(650, 'COM_PRIVACY_EMAIL_REQUEST_BODY_EXPORT_REQUEST', 'Quelqu\'un a créé une demande pour exporter toutes les informations personnelles liées à cette adresse e-mail sur [URL]. Par mesure de sécurité, vous devez confirmer qu\'il s\'agit d\'une demande valide d\'obtention de vos informations personnelles sur ce site Web.n\\n\\S\'il s\'agit d\'une erreur, ignorer le mail et cela n\'aura aucune conséquence.\\n\\nPour confirmer cette demande, vous pouvez effectuer l\'une des tâches suivantes:\\n\\n1. Visiter l\'URL suivante : [TOKENURL]\\n\\n2. Copier votre identifiant de sécurité ci-dessous, visiter l\'URL référencée et coller cet identifiant dans le formulaire.\\nURL: [FORMURL]\\nIdentifiant de sécurité : [TOKEN]\\n\\nVeuillez noter que cet identifiant n\'est valide que pendant 24 heures à compter de la date d\'envoi de cet e-mail.', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_privacy.ini'),
(651, 'COM_PRIVACY_EMAIL_REQUEST_BODY_REMOVE_REQUEST', 'Quelqu\'un a créé une demande pour supprimer toutes les informations personnelles liées à cette adresse e-mail sur [URL]. Par mesure de sécurité, vous devez confirmer qu\'il s\'agit d\'une demande valide d\'obtention de vos informations personnelles sur ce site Web.n\\n\\S\'il s\'agit d\'une erreur, ignorer le mail et cela n\'aura aucune conséquence.\\n\\nPour confirmer cette demande, vous pouvez effectuer l\'une des tâches suivantes:\\n\\n1. Visiter l\'URL suivante : [TOKENURL]\\n\\n2. Copier votre identifiant de sécurité ci-dessous, visiter l\'URL référencée et coller cet identifiant dans le formulaire.\\nURL: [FORMURL]\\nIdentifiant de sécurité : [TOKEN]\\n\\nVeuillez noter que cet identifiant n\'est valide que pendant 24 heures à compter de la date d\'envoi de cet e-mail.', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_privacy.ini'),
(652, 'COM_PRIVACY_EMAIL_REQUEST_SUBJECT_EXPORT_REQUEST', 'Demande d\'informations créée sur [SITENAME]', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_privacy.ini'),
