(721, 'COM_USERS_EMAIL_ACCOUNT_DETAILS', 'Détails du compte utilisateur de %s à %s', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_users.ini'),
(722, 'COM_USERS_EMAIL_ACTIVATE_WITH_ADMIN_ACTIVATION_BODY', 'Bonjour,\\n\\nUn nouvel utilisateur s\'est inscrit sur %s.\\nL\'utilisateur a confirmé son adresse e-mail et attend que vous approuviez son compte.\\nCe message contient ses détails :\\n\\n  Nom :  %s \\n  E-mail:  %s \\n Identifiant :  %s \\n\\nVous pouvez activer son compte en cliquant sur le lien ci-dessous :\\n %s \\n', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_users.ini'),
(723, 'COM_USERS_EMAIL_ACTIVATE_WITH_ADMIN_ACTIVATION_SUBJECT', 'Une approbation de l\'inscription est requise pour le compte de %s sur %s', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_users.ini'),
(724, 'COM_USERS_EMAIL_ACTIVATED_BY_ADMIN_ACTIVATION_BODY', 'Bonjour %s,\\n\\nVotre compte a été activé par un administrateur. Vous pouvez désormais vous connecter sur %s en utilisant l\'identifiant %s et le mot de passe que vous avez choisi lors de votre inscription.', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_users.ini'),
(725, 'COM_USERS_EMAIL_ACTIVATED_BY_ADMIN_ACTIVATION_SUBJECT', 'Compte activé pour %s sur %s', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_users.ini'),
(726, 'COM_USERS_EMAIL_PASSWORD_RESET_BODY', 'Bonjour,\\n\\nVous avez effectué une demande de réinitialisation du mot de passe de votre compte %s. Pour le réinitialiser, vous devrez saisir le code de vérification afin de confirmer qu\'il s\'agit bien d\'une demande légitime. \\n\\nLe code de vérification est %s\\n\\nCliquez sur l\'URL ci-dessous pour entrer ce code de vérification et pouvoir ensuite créer un nouveau mot de passe.\\n\\n %s \\n\\nMerci.', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_users.ini'),
(727, 'COM_USERS_EMAIL_PASSWORD_RESET_SUBJECT', 'Votre demande de réinitialisation de mot de passe pour %s', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_users.ini'),
(728, 'COM_USERS_EMAIL_REGISTERED_BODY', 'Bonjour %s. \\n\\nMerci de votre inscription sur %s.\\n\\nVous pouvez désormais vous connecter à %s avec votre identifiant et mot de passe :\\n\\nIdentifiant : %s\\nMot de passe : %s', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_users.ini'),
(729, 'COM_USERS_EMAIL_REGISTERED_BODY_NOPW', 'Bonjour %s. \\n\\n Merci de votre inscription sur %s.\\n\\n Vous pouvez désormais vous connecter à %s avec le nom d\'utilisateur et le mot de passe que vous avez choisi', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_users.ini'),
(730, 'COM_USERS_EMAIL_REGISTERED_NOTIFICATION_TO_ADMIN_BODY', 'Bonjour administrateur, \\nCette notification vous informe de l\'inscription sur le site de l\'utilisateur \'%s\' avec l\'identifiant \'%s\'.', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_users.ini'),
(731, 'COM_USERS_EMAIL_REGISTERED_WITH_ACTIVATION_BODY', 'Bonjour %s,\\n\\nMerci de vous être inscrit sur %s. Votre compte a été créé et doit être activé avant que vous puissiez l\'utiliser. \\nPour l\'activer, cliquez sur le lien ci-dessous ou copiez et collez le dans votre navigateur :\\n%s \\n\\nAprès activation vous pourrez vous connecter à %s en utilisant l\'identifiant et le mot de passe suivants :\\nIdentifiant : %s\\nMot de passe : %s', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_users.ini'),
(732, 'COM_USERS_EMAIL_REGISTERED_WITH_ACTIVATION_BODY_NOPW', 'Bonjour %s,\\n\\nMerci de vous être inscrit sur %s. Votre compte a été créé et doit être activé avant que vous puissiez l\'utiliser. \\nPour l\'activer, cliquez sur le lien ci-dessous ou copiez et collez le dans votre navigateur :\\n%s \\n\\nAprès activation vous pourrez vous connecter sur %s en utilisant l\'identifiant suivant et le mot de passe utilisé à l\'enregistrement :\\nIdentifiant : %s', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_users.ini'),
(733, 'COM_USERS_EMAIL_REGISTERED_WITH_ADMIN_ACTIVATION_BODY', 'Bonjour %s,\\n\\nMerci de vous être inscrit sur %s. Votre compte a été créé et doit être activé avant que vous puissiez l\'utiliser. \\nPour l\'activer, cliquez sur le lien ci-dessous ou copiez et collez le dans votre navigateur :\\n%s \\n\\nAprès cette activation, un administrateur sera averti afin de valider votre compte. Vous recevrez alors un message de confirmation.\\nUne fois que ce compte aura été validé, vous pourrez vous connecter sur %s en utilisant l\'identifiant et le mot de passe suivants :\\n\\nIdentifiant: %s\\nMot de passe: %s', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_users.ini'),
(734, 'COM_USERS_EMAIL_REGISTERED_WITH_ADMIN_ACTIVATION_BODY_NOPW', 'Bonjour %s,\\n\\nMerci de vous être inscrit sur %s. Votre compte a été créé et doit être activé avant que vous puissiez l\'utiliser. \\nPour l\'activer, cliquez sur le lien ci-dessous ou copiez et collez le dans votre navigateur :\\n%s \\n\\nAprès cette activation, un administrateur sera averti afin de valider votre compte. Vous recevrez alors un message de confirmation.\\nUne fois que ce compte aura été validé, vous pourrez vous connecter sur %s en utilisant l\'identifiant suivant et le mot de passe utilisé à l\'enregistrement :\\n\\nIdentifiant: %s', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_users.ini'),
(735, 'COM_USERS_EMAIL_USERNAME_REMINDER_BODY', 'Bonjour,\\n\\nUne demande de rappel d\'identifiant a été demandée pour votre compte %s.\\n\\nVotre identifiant est %s.\\n\\nPour vous connecter à votre compte, cliquez sur le lien ci-dessous.\\n\\n%s \\n\\nMerci.', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_users.ini'),
(736, 'COM_USERS_EMAIL_USERNAME_REMINDER_SUBJECT', 'Votre identifiant %s', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_users.ini'),
(737, 'COM_USERS_ERROR_SECRET_CODE_WITHOUT_TFA', 'Vous avez saisi un code secret mais l\'authentification en deux étapes n\'est pas activée dans vote compte d\'utilisateur. Si vous désirez utiliser un code secret pour sécuriser votre connexion, merci d\'éditer votre profil d\'utilisateur et d\'activer l\'authentification en deux étapes.', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.com_users.ini'),
