(2043, 'JLIB_RULES_SETTING_NOTES', 'Les modifications des droits s\'appliqueront à ce groupe ainsi qu\'aux groupes enfants, composants et contenus.<br /><em><strong>Refusé</strong></em> l\'emporte sur tout droit hérité, ainsi que tout droit d\'un groupe enfant, composant ou contenu ; s\'il y a conflit, <em><strong>Refusé</strong></em> est appliqué.<br /><em><strong>Non défini</strong></em> est équivalent à <em><strong>Refusé</strong></em> mais peut être modifié dans les groupes enfants, composants et contenus.', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.lib_joomla.ini'),
(2044, 'JLIB_RULES_SETTING_NOTES_ITEM', 'Les modifications des droits s\'appliqueront à cet élément. Noter que :<br /><em><strong>Hérité</strong></em> signifie que les droits globaux, groupe parent et catégorie seront utilisés.<br /><em><strong>Refusé</strong></em> signifie que quels que soient les droits globaux, ceux du groupe parent ou de la catégorie, le groupe concerné ne pourra utiliser cette action pour cet élément.<br /><em><strong>Autorisé</strong></em> signifie que le groupe concerné pourra utiliser cette action pour cet élément (mais s\'il y a conflit avec les droits globaux, le groupe parent ou la catégorie, ceci n\'aura pas d\'impact). Un conflit sera indiqué par <em><strong>Non autorisé (Hérité)</strong></em> dans la colonne \'Droits appliqués\'.', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.lib_joomla.ini'),
