(2530, 'MOD_LANGUAGES_FIELD_MODULE_LAYOUT_DESC', 'Utiliser la mise en page propre aux fichiers du module ou la remplacer par celle générée par les fichiers du template. La sélection \'Défaut\' affiche les drapeaux des langues disponibles.', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.mod_languages.ini'),
(2531, 'MOD_LANGUAGES_FIELD_USEIMAGE_DESC', 'Activer l\'affichage d\'images illustrant les drapeaux des différentes langues disponibles. Sinon seront utilisés les noms natifs des langues de contenu.', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.mod_languages.ini'),
