(2581, 'MOD_MENU_FIELD_ENDLEVEL_DESC', 'Sélectionnez le dernier niveau de sous-menu à afficher. Si vous sélectionnez \'Tous\', tous les niveaux seront visibles. Si vous sélectionnez la même valeur que celle de départ, un seul niveau sera affiché.', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.mod_menu.ini'),
