(2585, 'MOD_MENU_FIELD_STARTLEVEL_DESC', 'Spécifiez par une valeur numérique le premier niveau de menu (ou sous-menu) à partir duquel les liens doivent être affichés. Par exemple, pour simplifier la navigation, vous pouvez afficher une copie du menu principal dans les pages des liens enfants en masquant le premier niveau.', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.mod_menu.ini'),
