(2587, 'MOD_MENU_FIELD_TAG_ID_DESC', 'Vous pouvez spécifier une valeur numérique pour attribuer un identifiant unique à la balise primaire du menu (ul). Ceci est nécessaire si vous utilisez les mêmes noms pour des liens de différents menus.', 'C:\\xampp\\htdocs\\annonces\\language\\fr-FR\\fr-FR.mod_menu.ini'),
